    private static int[] removeSubsetElements(int[] originalArray, List<Integer> subset) {
        List<Integer> updatedList = new ArrayList<>();
        List<Integer> subsetList = new ArrayList<>(subset);
        for (int num : originalArray) {
            if (!subsetList.remove(Integer.valueOf(num))) {
                updatedList.add(num);
            }
        }
        return updatedList.stream().mapToInt(Integer::intValue).toArray();
    }

    /**
     * Finds a unique subset of the given array that sums up to the target sum using dynamic programming.
     *
     * @param array The array of integers.
     * @param targetSum The target sum for the subset.
     * @return A list of unique integers that add up to the target sum, or null if no such subset exists.
     */
    public static List<Integer> findUniqueSubsetWithTargetSum(int[] array, int targetSum) {
        int n = array.length;

        // Handle edge case where targetSum is 0
        if (targetSum == 0) {
            List<Integer> emptySubset = new ArrayList<>();
            return emptySubset;
        }

        // Create the dp table
        boolean[][] dp = new boolean[n + 1][targetSum + 1];

        // Initialize the dp table
        for (int i = 0; i <= n; i++) {
            dp[i][0] = true; // A sum of 0 can always be made with an empty subset
        }

        // Fill the dp table
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= targetSum; j++) {
                if (array[i - 1] <= j) {
                    dp[i][j] = dp[i - 1][j] || dp[i - 1][j - array[i - 1]];
                } else {
                    dp[i][j] = dp[i - 1][j];
                }
            }
        }

        // Trace back the unique subset
        List<Integer> subset = new ArrayList<>();
        if (dp[n][targetSum]) {
            int w = targetSum;
            Set<Integer> usedElements = new HashSet<>(); // To track used elements

            for (int i = n; i > 0 && w > 0; i--) {
                if (!dp[i - 1][w] && !usedElements.contains(array[i - 1])) {
                    subset.add(array[i - 1]);
                    usedElements.add(array[i - 1]);
                    w -= array[i - 1];
                }
            }
        }

        // Return subset if found, otherwise null
        return dp[n][targetSum] ? subset : null;
    }
